import "./App.css";
import { Button } from "react-bootstrap";
import Container from "react-bootstrap/Container";
import Avator from "./components/Avator";
import Header from "./components/Header";
import TextBlock from "./components/TextBlock";
import Foto from "./components/Foto";
import SlideShow from "./components/SlideShow";

function App() {
  return (
    <Container>
      <Header></Header>
      <h3>Hello, thanks for visiting this page. ðŸ˜€</h3>
      <br />

      <Avator></Avator>
      <br />
      <TextBlock
        title="Where I am from?"
        content="some description"
      ></TextBlock>
      <Foto path="./images/wuzhen.jpeg" alt="a photo of wuzhen"></Foto>

      <TextBlock
        title="What I like to eat??"
        content="some description"
      ></TextBlock>
      <SlideShow
        path1="./images/hotpot.jpg"
        captitle1="Hot Pot"
        captext1="a body warming dish that suit winter the most"
        path2="./images/mapotofu.jpeg"
        captitle2="title2"
        captext2="text2"
        path3="./images/jiaozi.jpeg"
        captitle3="title3"
        captext3="text3"
      ></SlideShow>

      <TextBlock
        title="What kind of music I enjoy listening?"
        content="some description"
      ></TextBlock>
    </Container>
  );
}

export default App;
